import { useState } from 'react';
import styles from './styles.module.css';
import Axios from 'axios';
import { Header, Userlist } from 'components';

export const App = () => {
  return (
    <div className={styles.main}>
      <div className={styles.text}>
        <Header />
        <Userlist />
      </div>
    </div>
  );
};

export default App;
